import React, { Component } from "react";
import NeowsResult from "./neowsResult";
import Failure from "../components/failure";
import { connect } from "react-redux";
import { getSpacex } from "../actions/formActions/actions";

export class NeowsStatus extends Component {
  componentDidMount() {
    this.props.dispatch(getSpacex());
  }
  render() {
    let renderedNeows;

    if (!this.props.default) {
      renderedNeows = <NeowsResult receivedInfo={this.props.receivedInfo} />;
    }

    if (this.props.failure) {
      renderedNeows = <Failure />;
    }

    return <div>{renderedNeows}</div>;
  }
}

const mapStateToProps = state => {
  state = state.FormReducer;
  return {
    default: state.default,
    failure: state.isFailure,
    receivedInfo: state.receivedInfo
  };
};

const spacexStatusConnected = connect(mapStateToProps)(NeowsStatus);
export default spacexStatusConnected;
